The interviews give insight into the fierce rivalry between Activision and EA, and how that rivalry led to the creation of Call of Duty. Back in 2003, when Infinity Ward was formed, Medal of Honor was the shooter franchise to beat - indeed, the original version of the game was much more similar to Allied Assault than the game it eventually became, said Zied Rieke, the COD lead designer who had previously worked on Medal of Honor with EA.

"It wasn’t just Medal of Honor we were wary of being similar to, because most of the World War II games at the time followed that formulae, like Return to Castle Wolfenstein, which was kind of a super-spy in WWII story," he said. “During the first year of Call of Duty development, the game was much more like Allied Assault. There was a James Bond-like character, doing a secret mission to stop the Nazis developing a nuclear bomb. There was a German scientist, and a German scientist’s daughter. Medal of Honor was a ‘James Bond in World War II’ kind of game, and that is what we were pretty much making."

The game was initially developed under the rather immodest codename "MOH killer", revealed Justin Thomas, an artist at Infinity Ward at the time.

Nowadays, of course, the names are different - it's Battlefield and Call of Duty that face off every year, rather than Medal of Honor - but it's still Activision and EA that dominate the first-person shooter space, and the rivalry still burns strong.

You can read much more about Activision and EA's early-days antagonism in the full story over at MCV.

